// App.js - Version corrigée avec les bons chemins d'import
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Ajustez ces chemins selon votre structure de dossiers
// Si les fichiers sont directement dans src/ :
import Home from './Home';
import SujetsThese from './SujetsThese';
import Candidature from './Candidature';
import Login from './Login';
import Register from './Register';
import SuiviCandidature from './SuiviCandidature';
import Doctorants from './Doctorants';
import Encadrants from './Encadrants';
import EquipesRecherche from './EquipesRecherche';
import EspaceProfesseur from './EspaceProfesseur';
import DashboardCandidat from './DashboardCandidat';

// OU si vos fichiers sont dans un dossier pages/ :
// import Home from './pages/Home';
// import SujetsThese from './pages/SujetsThese';
// etc...

// OU si vos fichiers sont dans un dossier views/ :
// import Home from './views/Home';
// import SujetsThese from './views/SujetsThese';
// etc...

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/sujets-these" element={<SujetsThese />} />
          <Route path="/candidature" element={<Candidature />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/suivi-candidature" element={<SuiviCandidature />} />
          <Route path="/doctorants" element={<Doctorants />} />
          <Route path="/encadrants" element={<Encadrants />} />
          <Route path="/equipes-recherche" element={<EquipesRecherche />} />
          <Route path="/espace-professeur" element={<EspaceProfesseur />} />
          <Route path="/dashboard-candidat" element={<DashboardCandidat />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
